<div class="textwrapper"><textarea placeholder="Write a comment..." oninput="this.innerHTML = this.value;pybridge._add_comment(this.parentNode.parentNode.id, this.value);">Part 3, Q12.
Linear kernel without resampling: the decision boundary would be a straight line. Since the data is not linear, it is hard for this model to distinguish complex relationships between features and would ignore minority classes (Class 2), which results in misclassification.

Quadratic kernel without resampling: The decision boundary could be curved with more flexibility than linear kernel. However, the issue of class imbalance might still persists, resulting Class 2 being underrepresented.

Quadratic kernel resampled: The scatterplot would show a more balanced distribution after resampling. Now the decision boundary could better separate the features and distinguish Class 2 from Class 0 and 1, as the model is less biased due to the elimination of imbalance, resulting in more accurate predictions overall.</textarea></div></div></body></html>
